import {Routes,Route} from 'react-router-dom'
import {Signup} from '../Pages/Signup'


const AllRoutes = () => {
  return <>
  <Routes>
    <Route path="/" element={<Signup/>}/>
    <Route path="/login" element={<Signup/>}/>

  </Routes>
  </>;
};

export default AllRoutes;
